const ConvertDataForLineChart = (eventDurations) => {
    const lineChartData = [];

    // Iterar sobre os dados de duração do evento
    for (const eventType in eventDurations) {
        // Obter as durações para o tipo de evento atual
        const durations = eventDurations[eventType];

        // Para cada duração, criar um objeto com a duração como x e o nome do evento como y
        durations.forEach((duration) => {
            lineChartData.push({
                x: duration,
                y: eventType,
            });
        });
    }

    return lineChartData;
};


  export default ConvertDataForLineChart;
